import React from 'react';
import { Container, Card, Col } from 'react-bootstrap';


const Home:React.FC = () => {
    return (
     <Card
          style={{ width: '18rem',border:'none' }}
          className="mt-5 text-center"
        >
          <Card.Body>

          <Card.Img src='/img/me.jpg' style={{position:'absolute'}} />

            <Card.Title> Hello </Card.Title>
            <Card.Text>
              I am Ionut Ciornei
            </Card.Text>
          </Card.Body>
          </Card>
    )
};

export default Home;
